import React, { Component } from 'react';
import { BrowserRouter, Route } from 'react-router-dom'; 

const NewRoute = () => {
  return(
    <div>
      <p>New Route</p>
    </div>
  )
}

// The router takes in the parameter of the name of the the URL that we use, 
// which is the path we want to call it.

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Route path='/new' component={NewRoute} />
      </BrowserRouter>
      );
    }
  }

export default App;
